import React, { Component } from "react";
import { HashRouter as Router, Route } from "react-router-dom";
import Home from "./Home/Home.js";
import Search from "./Search.js";
import Contact from "./Contact/Contact.js";
import About from "./About.js";
import data from "../SIMULATION_DATABASE/data_BlockNews.json";
import FVdata from "../SIMULATION_DATABASE/data_NewsFullView.json";
// import component xem full bảng tin
import NewsFullView from "./Home/news/NewsFullView.js";

class RouterURL extends Component {
  render() {
    return (
      <div>
        <Route exact path="/" component={Home} />
        <Route exact path="/home" component={Home} />
        <Route exact path="/search" component={Search} />
        <Route exact path="/contact" component={Contact} />
        <Route exact path="/about" component={About} />
        {/* chuyển đến trang xem full bảng tin */}

        <Route
          exact
          path={"/" + data[0].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[0].title}
              imgFullView={FVdata[0].image}
              contentFullView={FVdata[0].content}
              partURL_plugin_fb={data[0].linkTopic}
            />
          )}
        />
        <Route
          exact
          path={"/" + data[1].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[1].title}
              imgFullView={FVdata[1].image}
              contentFullView={FVdata[1].content}
              partURL_plugin_fb={data[1].linkTopic}
            />
          )}
        />
        <Route
          exact
          path={"/" + data[2].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[2].title}
              imgFullView={FVdata[2].image}
              contentFullView={FVdata[2].content}
              partURL_plugin_fb={data[2].linkTopic}
            />
          )}
        />
        <Route
          exact
          path={"/" + data[3].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[3].title}
              imgFullView={FVdata[3].image}
              contentFullView={FVdata[3].content}
              partURL_plugin_fb={data[3].linkTopic}
            />
          )}
        />
        <Route
          exact
          path={"/" + data[4].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[4].title}
              imgFullView={FVdata[4].image}
              contentFullView={FVdata[4].content}
              partURL_plugin_fb={data[4].linkTopic}
            />
          )}
        />
        <Route
          exact
          path={"/" + data[5].linkTopic}
          render={(props) => (
            <NewsFullView
              titleFullView={FVdata[5].title}
              imgFullView={FVdata[5].image}
              contentFullView={FVdata[5].content}
              partURL_plugin_fb={data[5].linkTopic}
            />
          )}
        />
        
      </div>
    );
  }
}

export default RouterURL;
